o w&oacute;zkach dość typowych jednak, gdy potrzebujemy prawdziwego &bdquo;potwora&rdquo; wyposażonego w najnowszą technologię to możemy nie zmieścić się w 300 tyś PLN. Podsumowując i patrząc się na te ceny to zupełnie tak jak z samochodami, a czy ktoś wyobraża sobie prowadzenie działalności gospodarczej bez samochodu? Raczej jest to trudne. Dlatego każdy, kto potrzebuje w&oacute;zka widłowego powinien go kupić tak jak każdy, kto potrzebuje samochodu. Jeżeli myślicie poważnie o rozwoju swojego biznesu to mam nadzieję, że nie zmarnowaliście czasu czytając ten artykuł.</p>','pl','zastosowanie-wozkow-widlowych'),(2,'Historia wózków widłowych','Pod koniec XIX w. a na początku XX miały miejsce wydarzenia które doprowadziły do powstania nowoczesnych wózków widłowych. W 1906 r. amerykańskie linie kolejowe wprowadziły w ciężarowych platformach do przewożenia bagaży zasilanie akumulatorowe.','<p>Pod koniec XIX w. a na początku XX miały miejsce wydarzenia kt&oacute;re doprowadziły do powstania nowoczesnych w&oacute;zk&oacute;w widłowych. W 1906 r. amerykańskie linie kolejowe wprowadziły w ciężarowych platformach do przewożenia bagaży zasilanie akumulatorowe. Następnie wybuch I Wojny Światowej spowodował silny rozw&oacute;j r&oacute;żnych pojazd&oacute;w transportowych. Było to po części spowodowane brakiem ludzi do pracy.</p>\r\n<p>Pierwsze w&oacute;zki widłowe zostały niemal jednocześnie wyprodukowane przez kilka firm w tym Clark (obecnie Clark Material Handling Company) i Yale &amp; Towne Manufacturing. Clark wyprodukował sw&oacute;j pierwszy w&oacute;zek widłowy już w 1917 roku i wypuścił go na rynek amerykański.</p>\r\n<p>W latach 1920 i 19030 kontynuowano rozw&oacute;j w&oacute;zk&oacute;w widłowych. Podczas I jak i II wojny w&oacute;zki widłowe wykorzystywane były do działań wojennych. Po wojnie zaczęto je używać bardziej efektywnie między innymi w magazynach wspomagając proces przechowywania produkt&oacute;w. W ciasnych powierzchniach magazynowych niezbędne były w&oacute;zki bardziej zwrotne, kt&oacute;re potrafiły jednocześnie umieszczać towary na coraz to większych wysokościach. Nowe modele w&oacute;zk&oacute;w coraz precyzyjniej realizowały ta potrzebę. W 1956 roku Toyota wprowadziła na rynek sw&oacute;j pierwszy w&oacute;zek podnośnikowy. Początkowo ten model dostępny był tylko na rynku japońskim ale już w 1967 dostępny był r&oacute;wnież na rynku amerykańskim.</p>','de','historia-wozkow-widlowych'),(2,'Historia wózków widłowych','Pod koniec XIX w. a na początku XX miały miejsce wydarzenia które doprowadziły do powstania nowoczesnych wózków widłowych. W 1906 r. amerykańskie linie kolejowe wprowadziły w ciężarowych platformach do przewożenia bagaży zasilanie akumulatorowe.','<p>Pod koniec XIX w. a na początku XX miały miejsce wydarzenia kt&oacute;re doprowadziły do powstania nowoczesnych w&oacute;zk&oacute;w widłowych. W 1906 r. amerykańskie linie kolejowe wprowadziły w ciężarowych platformach do przewożenia bagaży zasilanie akumulatorowe. Następnie wybuch I Wojny Światowej spowodował silny rozw&oacute;j r&oacute;żnych pojazd&oacute;w transportowych. Było to po części spowodowane brakiem ludzi do pracy.</p>\r\n<p>Pierwsze w&oacute;zki widłowe zostały niemal jednocześnie wyprodukowane przez kilka firm w tym Clark (obecnie Clark Material Handling Company) i Yale &amp; Towne Manufacturing. Clark wyprodukował sw&oacute;j pierwszy w&oacute;zek widłowy już w 1917 roku i wypuścił go na rynek amerykański.</p>\r\n<p>W latach 1920 i 19030 kontynuowano rozw&oacute;j w&oacute;zk&oacute;w widłowych. Podczas I jak i II wojny w&oacute;zki widłowe wykorzystywane były do działań wojennych. Po wojnie zaczęto je używać bardziej efektywnie między innymi w magazynach wspomagając proces przechowywania produkt&oacute;w. W ciasnych powierzchniach magazynowych niezbędne były w&oacute;zki bardziej zwrotne, kt&oacute;re potrafiły jednocześnie umieszczać towary na coraz to większych wysokościach. Nowe modele w&oacute;zk&oacute;w coraz precyzyjniej realizowały ta potrzebę. W 1956 roku Toyota wprowadziła na rynek sw&oacute;j pierwszy w&oacute;zek podnośnikowy. Początkowo ten model dostępny był tylko na rynku japońskim ale już w 1967 dostępny był r&oacute;wnież na rynku amerykańskim.</p>','pl','historia-wozkow-widlowych'),(3,'Wózek widłowy','Właściwa nazwa wózka widłowego to wózek podnośnikowy. Obecnie stosujemy nazwę &bdquo;wózek widłowy&rdquo; dla opisania całej gamy różnych wózków w tym też prowadzonych ręcznie, bądź zdalnie przez operatora. Najtrafniejszą nazwą stosowaną w naszym języku i określoną przez polską normę PN-77/M-78100 to wózek jezdniowy.','<p>Właściwa nazwa w&oacute;zka widłowego to w&oacute;zek podnośnikowy. Obecnie stosujemy nazwę &bdquo;w&oacute;zek widłowy&rdquo; dla opisania całej gamy r&oacute;żnych w&oacute;zk&oacute;w w tym też prowadzonych ręcznie, bądź zdalnie przez operatora. Najtrafniejszą nazwą stosowaną w naszym języku i określoną przez polską normę PN-77/M-78100 to w&oacute;zek jezdniowy.</p>\r\n<p>W&oacute;zki w ostatnich latach stały się standardowym wyposażeniem w polskich firmach. Niezależnie czy firma zajmuje się produkcją towar&oacute;w czy tylko ich sprzedażą. Są to pojazdy o napędzie silnikowym, przeznaczone do transportu bliskiego i przewozu materiał&oacute;w o znacznej masie. (specjalne modele mają udźwig nawet do 50 ton). Materiały przeznaczone do przemieszczania umieszcza się na drewnianych paletach w celu ich stabilnego transportu.</p>\r\n<p>Typowe w&oacute;zki widłowe składają się z:</p>\r\n<ul>\r\n<li>szkieletu w&oacute;zka, wykonanego ze stali,</li>\r\n<li>kabiny operatora w kt&oacute;rej umieszczone są kierownica, pedały i dźwignie umożliwiającymi sterowanie w&oacute;zkiem( kabina najczęściej jest otwarta, posiada jednak zabezpieczenie w postaci klatki chroniące operatora w&oacute;zka przed wypadkami),</li>\r\n<li>k&oacute;ł; zależnie od zastosowania czterech bądź trzech,</li>\r\n<li>metalowej klatki bezpieczeństwa, zabezpieczającej operatora w&oacute;zka przed spadającymi z g&oacute;ry przedmiotami,</li>\r\n<li>silnika niskoprężnego zasilanego benzyną lub gazem ciekłym LPG, silnika wysokoprężnego zasilanego ropą, jak r&oacute;wnież elektrycznego, zasilanego baterią akumulatorową,</li>\r\n<li>przeciwwagi, czyli dodatkowego obciążenia, z reguły z bloku stali, umieszczonego w tylnej części w&oacute;zka w celu zapewnienia r&oacute;wnowagi podczas transportu bardzo ciężkich ładunk&oacute;w,</li>\r\n<li>masztu, zamocowanego pionowo z przodu w&oacute;zka, kt&oacute;rego ruchoma konstrukcja pozwala na podnoszenie, opuszczanie i pochylanie materiał&oacute;w,</li>\r\n<li>karetki &ndash; stalowego elementu zamocowanego do masztu, na kt&oacute;rym z kolei montuje się widły oraz kratkę ochronną,</li>\r\n<li>wideł, wykonanych z jednolitego kawałka stali lub innych, niestandardowych chwytnik&oacute;w, przystosowanych do transportu beczek, pudeł kartonowych, odśnieżania i innych zastosowań,</li>\r\n<li>kraty ochronnej, zamocowanej do karetki, w celu ochrony operatora w&oacute;zka.</li>\r\n</ul>\r\n<p>Elementami sterującymi ruchem w&oacute;zka to kierownica, pedał hamulca i gazu jak i czasami sprzęgło w zależności od zamieszczonego układu napędowego. W większości w&oacute;zk&oacute;w widłowych są dwa biegi: do przodu i wsteczny. Sterowanie w&oacute;zka widłowego obejmuje sterowanie ruchem samego w&oacute;zka, oraz sterowanie masztem i widłami w celu podnoszenia, opuszczania lub przechylania ładunku.</p>\r\n<p>Prowadzenie w&oacute;zka widłowego wymaga od operatora specjalnych umiejętności, dlatego należy być odpowiednio przeszkolonym w tym zakresie. Zezwolenie do obsługi w&oacute;zka wydają specjalne instytucje. &lsquo;Widlak&rsquo; jest pojazdem zwrotniejszym od samochodu ponieważ często dokonuje się nim manewry na małych powierzchniach, używając maksymalnego skrętu k&oacute;ł. Należy r&oacute;wnież pamiętać aby nie prowadzić w&oacute;zka z nadmierną prędkością zwłaszcza przy podniesionym wysoko ładunku, gdyż może to grozić wypadkiem (przechylenie w&oacute;zka).</p>\r\n<p>Parametry techniczne w&oacute;zka widłowego umieszczone są przez producenta w&oacute;zka na tabliczce znamionowej. Dla bezpieczeństwa, nie powinno się przekraczać dopuszczalnego maksymalnego obciążenia podanego na tabliczce.</p>\r\n<p>Obecnie w&oacute;zki widłowe są bardzo zaawansowanymi maszynami często wyposażonymi w bardzo nowoczesną technologię co jednocześnie powoduje że są dość drogimi pojazdami.</p>','de','wozek-widlowy'),(3,'Wózek widłowy','Właściwa nazwa wózka widłowego to wózek podnośnikowy. Obecnie stosujemy nazwę &bdquo;wózek widłowy&rdquo; dla opisania całej gamy różnych wózków w tym też prowadzonych ręcznie, bądź zdalnie przez operatora. Najtrafniejszą nazwą stosowaną w naszym języku i określoną przez polską normę PN-77/M-78100 to wózek jezdniowy.','<p>Właściwa nazwa w&oacute;zka widłowego to w&oacute;zek podnośnikowy. Obecnie stosujemy nazwę &bdquo;w&oacute;zek widłowy&rdquo; dla opisania całej gamy r&oacute;żnych w&oacute;zk&oacute;w w tym też prowadzonych ręcznie, bądź zdalnie przez operatora. Najtrafniejszą nazwą stosowaną w naszym języku i określoną przez polską normę PN-77/M-78100 to w&oacute;zek jezdniowy.</p>\r\n<p>W&oacute;zki w ostatnich latach stały się standardowym wyposażeniem w polskich firmach. Niezależnie czy firma zajmuje się produkcją towar&oacute;w czy tylko ich sprzedażą. Są to pojazdy o napędzie silnikowym, przeznaczone do transportu bliskiego i przewozu materiał&oacute;w o znacznej masie. (specjalne modele mają udźwig nawet do 50 ton). Materiały przeznaczone do przemieszczania umieszcza się na drewnianych paletach w celu ich stabilnego transportu.</p>\r\n<p>Typowe w&oacute;zki widłowe składają się z:</p>\r\n<ul>\r\n<li>szkieletu w&oacute;zka, wykonanego ze stali,</li>\r\n<li>kabiny operatora w kt&oacute;rej umieszczone są kierownica, pedały i dźwignie umożliwiającymi sterowanie w&oacute;zkiem( kabina najczęściej jest otwarta, posiada jednak zabezpieczenie w postaci klatki chroniące operatora w&oacute;zka