INSERT INTO `news_translation` VALUES (1,'Nowy Rok 2010','Z okazji Nowego Roku 2010 życzymy Państwu wielu sukcesów w życiu osobistym oraz zawodowym.','<p>Z okazji Nowego Roku 2010 życzymy Państwu wielu sukces&oacute;w w życiu osobistym oraz zawodowym.</p>','de','nowy-rok-2010'),(1,'Nowy Rok 2010','Z okazji Nowego Roku 2010 życzymy Państwu wielu sukcesów w życiu osobistym oraz zawodowym.','<p>Z okazji Nowego Roku 2010 życzymy Państwu wielu sukces&oacute;w w życiu osobistym oraz zawodowym.</p>','pl','nowy-rok-2010'),(2,'Nowa oferta','Zapraszamy do zapoznania się z nową ofertą wózków widłowych','<p>Zapraszamy do zapoznania się z nową ofertą w&oacute;zk&oacute;w widłowych</p>','de','nowa-oferta'),(2,'Nowa oferta','Zapraszamy do zapoznania się z nową ofertą wózków widłowych','<p>Zapraszamy do zapoznania się z nową ofertą w&oacute;zk&oacute;w widłowych</p>','pl','nowa-oferta'),(3,'Mitsubishi podbija rynek','Mitsubishi ogłosił niedawno wprowadzenie nowej linii wózków widłowych.','<p>Mitsubishi producent niezawodnych i przystępnych cenowo w&oacute;zk&oacute;w widłowych, do ciężkich zastosowań, ogłosił niedawno wprowadzenie nowej linii średniej wielkości w&oacute;zk&oacute;w widłowych (wewnętrznego spalania - IC) z pneumatycznymi oponami. Dostępne w pięciu konfiguracjach, począwszy od 8,000-12,000 kg., Pojazdy są przeznaczone do pracy w trudnych warunkach, takich jak drewno, cement i rury. Kilka nowych udoskonaleń produktu będzie r&oacute;wnież oferowana klientom w ramach istniejącej klasy 4 i 5 linii produkt&oacute;w.<br /><br />\"Mitsubishi - w&oacute;zki widłowe pozostaje zobowiązana do zapewnienia niezawodnych i przystępnych cenowo w&oacute;zki dla naszych klient&oacute;w\", powiedział Jeff Rufener, wiceprezes ds. marketingu, Mitsubishi - w&oacute;zki widłowe. \"Naszym celem jest nadal produkcji sprzętu, kt&oacute;ry będzie najlepszy pod względem komfortu operatora i kontroli, przy jednoczesnym dbaniu o portfel naszych klient&oacute;w\".</p>','de','mitsubishi-podbija-rynek'),(3,'Mitsubishi podbija rynek','Mitsubishi ogłosił niedawno wprowadzenie nowej linii wózków widłowych.','<p>Mitsubishi producent niezawodnych i przystępnych cenowo w&oacute;zk&oacute;w widłowych, do ciężkich zastosowań, ogłosił niedawno wprowadzenie nowej linii średniej wielkości w&oacute;zk&oacute;w widłowych (wewnętrznego spalania - IC) z pneumatycznymi oponami. Dostępne w pięciu konfiguracjach, począwszy od 8,000-12,000 kg., Pojazdy są przeznaczone do pracy w trudnych warunkach, takich jak drewno, cement i rury. Kilka nowych udoskonaleń produktu będzie r&oacute;wnież oferowana klientom w ramach istniejącej klasy 4 i 5 linii produkt&oacute;w.<br /><br />\"Mitsubishi - w&oacute;zki widłowe pozostaje zobowiązana do zapewnienia niezawodnych i przystępnych cenowo w&oacute;zki dla naszych klient&oacute;w\", powiedział Jeff Rufener, wiceprezes ds. marketingu, Mitsubishi - w&oacute;zki widłowe. \"Naszym celem jest nadal produkcji sprzętu, kt&oacute;ry będzie najlepszy pod względem komfortu operatora i kontroli, przy jednoczesnym dbaniu o portfel naszych klient&oacute;w\".</p>','pl','mitsubishi-podbija-rynek'),(4,'Mitsubishi konkurs \"Dealer Roku\" rozstrzygnięty','Mitsubishi - wózki widłowe ogłosiły zwycięzców konkursu \"Dążenie do doskonałości\" Dealer Roku 2010.','<p>Mitsubishi - w&oacute;zki widłowe ogłosiły zwycięzc&oacute;w konkursu \"Dążenie do doskonałości\" Dealer Roku 2010. Zwycięzcy tej nagrody są wybierani na podstawie wynik&oacute;w sprzedaży z 2009 roku, relacji z klientami oraz za wiedzę odnośnie w&oacute;zk&oacute;w widłowych Mitsubishi. Zwycięzcy otrzymali nagrody w postaci w nowych maszyny i części do sprzedaży.</p>','de','mitsubishi-konkurs-dealer-roku-rozstrzygniety'),(4,'Mitsubishi konkurs \"Dealer Roku\" rozstrzygnięty','Mitsubishi - wózki widłowe ogłosiły zwycięzców konkursu \"Dążenie do doskonałości\" Dealer Roku 2010.','<p>Mitsubishi - w&oacute;zki widłowe ogłosiły zwycięzc&oacute;w konkursu \"Dążenie do doskonałości\" Dealer Roku 2010. Zwycięzcy tej nagrody są wybierani na podstawie wynik&oacute;w sprzedaży z 2009 roku, relacji z klientami oraz za wiedzę odnośnie w&oacute;zk&oacute;w widłowych Mitsubishi. Zwycięzcy otrzymali nagrody w postaci w nowych maszyny i części do sprzedaży.</p>','pl','mitsubishi-konkurs-dealer-roku-rozstrzygniety'),(5,'Kabina delux','Mitsubishi - wózki widłowe dodał ostatnio do swojej oferty kabinę odchylaną (delux).','<p>Mitsubishi - w&oacute;zki widłowe dodał ostatnio do swojej oferty kabinę odchylaną (delux). Jest stosowana w z sukcesem w nowej serii N z 1,5 do 3,5 tony. Kabina została zaprojektowane z myślą o wysoki poziom komfortu i ergonomii, kt&oacute;re zmniejszają zmęczenie i powodują wzrost efektywności operatora.</p>','de','kabina-delux'),(5,'Kabina delux','Mitsubishi - wózki widłowe dodał ostatnio do swojej oferty kabinę odchylaną (delux).','<p>Mitsubishi - w&oacute;zki widłowe dodał ostatnio do swojej oferty kabinę odchylaną (delux). Jest stosowana w z sukcesem w nowej serii N z 1,5 do 3,5 tony. Kabina została zaprojektowane z myślą o wysoki poziom komfortu i ergonomii, kt&oacute;re zmniejszają zmęczenie i powodują wzrost efektywności operatora.</p>','pl','kabina-delux'),(6,'Nowe modele pieszych wózków widłowych','Mitsubishi wprowadza do swojej oferty nowe piesze wózki widłowe z zasilaniem elektrycznym. Nowe modele wykorzystują najnowsze silniki o bardzo dużej sprawności energetycznej, w związku z tym zwiększa się efektywności zużycia energii.','<p>Mitsubishi wprowadza do swojej oferty nowe piesze w&oacute;zki widłowe z zasilaniem elektrycznym. Nowe modele wykorzystują najnowsze silniki o bardzo dużej sprawności energetycznej, w związku z tym zwiększa się efektywności zużycia energii. Jest to jedno z wielu udoskonaleń jakie można znaleźć w nowej serii SBP 1,0 do 1,6 tony pieszych w&oacute;zk&oacute;w widłowych. Widlaki r&oacute;wnież wyposażone sa w ergonomiczne ramię sterownicy i wyjątkowo kompaktową przepustnice, kt&oacute;ra w połączeniu z bardzo wąskim podwoziem i doskonałą widocznością jest bardzo mobilna nawet w najmniejszej przestrzeniach.</p>','de','nowe-modele-pieszych-wozkow-widlowych'),(6,'Nowe modele pieszych wózków widłowych','Mitsubishi wprowadza do swojej oferty nowe piesze wózki widłowe z zasilaniem elektrycznym. Nowe modele wykorzystują najnowsze silniki o bardzo dużej sprawności energetycznej, w związku z tym zwiększa się efektywności zużycia energii.','<p>Mitsubishi wprowadza do swojej oferty nowe piesze w&oacute;zki widłowe z zasilaniem elektrycznym. Nowe modele wykorzystują najnowsze silniki o bardzo dużej sprawności energetycznej, w związku z tym zwiększa się efektywności zużycia energii. Jest to jedno z wielu udoskonaleń jakie można znaleźć w nowej serii SBP 1,0 do 1,6 tony pieszych w&oacute;zk&oacute;w widłowych. Widlaki r&oacute;wnież wyposażone sa w ergonomiczne ramię sterownicy i wyjątkowo kompaktową przepustnice, kt&oacute;ra w połączeniu z bardzo wąskim podwoziem i doskonałą widocznością jest bardzo mobilna nawet w najmniejszej przestrzeniach.</p>','pl','nowe-modele-pieszych-wozkow-widlowych'),(7,'Wózek widłowy przyjazny dla środowiska?','Czy wózek widłowy może być przyjazny dla środowiska? Okazuje się że tak. Mitsubishi wózki widłowe informuje, o pracach nad wózkami w technologii hybrydowej.','<p>Czy w&oacute;zek widłowy może być przyjazny dla środowiska? Okazuje się że tak.&nbsp;Mitsubishi w&oacute;zki widłowe informuje, o pracach nad w&oacute;zkami w technologii hybrydowej. Na rynek europejski mają trafić w 2011 r. Obecnie dostępne są w Japonii. Pierwszy na świecie w&oacute;zek widłowy o napędzie litowo-jonowych akumulator&oacute;w oraz silnika diesela cechuje się dużą wydajnością, gdyż badania umożliwiły wyciągnięcie następujących wniosk&oacute;w. Praca w&oacute;zka widłowego wiąże się zwykle z wielu kr&oacute;tkich cykli przyspieszania i zwalniania, o wysokim zapotrzebowaniu na energię, dlatego korzystanie z technologii hybrydowych w widlakach mogą być tak korzystne. Producent podaje 39-cio procentowe spadki zużycia paliwa oraz spadek emisji CO2, dzięki temu w&oacute;zi tego typu będą w przyszłości pracować także w halach magazynowych w kt&oacute;rych przebywają ludzie.</p>','de','wozek-widlowy-przyjazny-dla-srodowiska'),(7,'Wózek widłowy przyjazny dla środowiska?','Czy wózek widłowy może być przyjazny dla środowiska? Okazuje się że tak. Mitsubishi wózki widłowe informuje, o pracach nad wózkami w technologii hybrydowej.','<p>Czy w&oacute;zek widłowy może być przyjazny dla środowiska? Okazuje się że tak.&nbsp;Mitsubishi w&oacute;zki widłowe informuje, o pracach nad w&oacute;zkami w technologii hybrydowej. Na rynek europejski mają trafić w 2011 r. Obecnie dostępne są w Japonii. Pierwszy na świecie w&oacute;zek widłowy o napędzie litowo-jonowych akumulator&oacute;w oraz silnika diesela cechuje się dużą wydajnością, gdyż badania umożliwiły wyciągnięcie następujących wniosk&oacute;w. Praca w&oacute;zka widłowego wiąże się zwykle z wielu kr&oacute;tkich cykli przyspieszania i zwalniania, o wysokim zapotrzebowaniu na energię, dlatego korzystanie z technologii hybrydowych w widlakach mogą być tak korzystne. Producent podaje 39-cio procentowe spadki zużycia paliwa oraz spadek emisji CO2, dzięki temu w&oacute;zi tego typu będą w przyszłości pracować także w halach magazynowych w kt&oacute;rych przebywają ludzie.</p>','pl','wozek-widlowy-przyjazny-dla-srodowiska'),(9,'Nowa oferta ','','','de','nowa-oferta-1'),(9,'Nowa oferta ','','','en','nowa-oferta'),(9,'Nowa oferta ','Zapraszamy do zapoznania się z nową ofertą wózków widłowych.','<p>Nowa oferta w&oacute;zk&oacute;w widłowych , tylko teraz w bardzo atrakcyjnych cenach .</p>\r\n<p>Zapraszamy do zapozniania się</p>\r\n<p><a title=\"NAJNOWSZA OFERTA \" href=\"../../../oferta/1/wozki-widlowe-uzywane\">http://www.wozki-pl.com/oferta/1/wozki-widlowe-uzywane</a></p>','pl','nowa-oferta-1'),(9,'Nowa oferta ','','','ru','nowa-oferta');
