INSERT INTO `text_translation` VALUES (1,'Über uns','<p><span id=\"result_box\" lang=\"de\"><span class=\"hps\">Unsere Firma</span> <span class=\"hps\">wurde kontinuierlich</span> <span class=\"hps\">arbeiten seit &uuml;ber</span> <span class=\"hps\">15 Jahren.</span> <span class=\"hps\">Wir verkaufen</span> <span class=\"hps\">gebrauchte Gabelstapler</span> <span class=\"hps\">und</span> <span class=\"hps\">Lagertechnik</span> <span class=\"hps\">der weltweit f&uuml;hrenden</span> <span class=\"hps\">Marken.</span><br /><br /><span class=\"hps\">Stapler</span> <span class=\"hps\">von uns</span> <span class=\"hps\">angeboten werden, sind</span> <span class=\"hps\">jeweils</span> <span class=\"hps\">Gegenstand einer umfassenden</span> <span class=\"hps\">&Uuml;berpr&uuml;fung der</span> <span class=\"hps\">technischen,</span> <span class=\"hps\">so dass Sie</span> <span class=\"hps\">von uns gekauft</span> <span class=\"hps\">das Ger&auml;t</span> <span class=\"hps\">ist</span> <span class=\"hps\">sofort einsatzbereit</span><span>.</span><br /><br /><span class=\"hps\">Jede Maschine</span> <span class=\"hps\">von uns verkauft</span> <span class=\"hps\">hat volle</span> <span class=\"hps\">technische Dokumentation</span> <span class=\"hps\">-</span> <span class=\"hps\">k&ouml;rperliche</span> <span class=\"hps\">UDT</span><span>.</span> <span class=\"hps\">Auf Wunsch &uuml;bernehmen wir</span> <span class=\"hps\">auch</span> <span class=\"hps\">forschen</span> <span class=\"hps\">UDT</span> <span class=\"hps\">in unserem Unternehmen.</span><br /><br /><span class=\"hps\">Wunsch des Kunden</span> <span class=\"hps\">f&uuml;r weitere</span> <span class=\"hps\">Wagen sind</span> <span class=\"hps\">mit Zubeh&ouml;r</span> <span class=\"hps\">Spezialist</span> <span class=\"hps\">bewaffnet.</span> <span class=\"hps\">dh</span> <span class=\"hps\">seitliche Verschiebung</span><span>, Rotator</span><span>,</span> <span class=\"hps\">Stellungsregler</span><span>,</span> <span class=\"hps\">Ballenklammer</span><span>, hydraulische</span> <span class=\"hps\">Schaufel,</span> <span class=\"hps\">Schneepflug</span> <span class=\"hps\">usw.</span><br /><br /><span class=\"hps\">In unserem Angebot</span> <span class=\"hps\">finden Sie auch</span><span>:</span><br /><br />&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"hps\">Fork</span><br />&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"hps\">Neuen und gebrauchten Reifen</span><br />&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"hps\">Masten</span> <span class=\"hps\">f&uuml;r Traktoren</span><br />&nbsp;&nbsp;&nbsp;&nbsp; <span class=\"hps\">Ersatzteile f&uuml;r</span> <span class=\"hps\">neue und gebrauchte</span><br /><br /><span class=\"hps\">Wenn Sie</span> <span class=\"hps\">irgendwelche Fragen haben,</span> <span class=\"hps\">bitte anrufen oder</span> <span class=\"hps\">e-mail:</span><br /><br /><span class=\"hps\">Babin</span> <span class=\"hps\">Olędry</span> <span class=\"hps\">10</span> </span></p>\r\n<p><span id=\"result_box\" lang=\"de\"><span class=\"hps\">62-420 </span></span><span id=\"result_box\" lang=\"de\"><span class=\"hps\">Strzałkowo</span></span></p>\r\n<p><span id=\"result_box\" lang=\"de\"> <span class=\"hps\">Telefon</span> +48 <span class=\"hps\">602</span> <span class=\"hps\">725</span> <span class=\"hps\">994</span> <span class=\"hps\">oder</span> +48 <span class=\"hps\">666</span> <span class=\"hps\">843</span> <span class=\"hps\">578</span><br /><span class=\"hps\"><a href=\"mailto:biuro@wozki-pl.com\">biuro@wozki-pl.com </a><br /></span></span></p>','de'),(1,'About Us','Our company has been operating continuously for over 15 years. We sell used forklifts and warehouse trucks the world\'s leading brands.\r\n\r\nForklifts offered by us are each subject to a comprehensive review of the technical, so you bought from us the equipment is ready for use immediately.\r\n\r\nEvery machine sold by us has full technical documentation - physical UDT. On request, we also conduct research UDT in our company.\r\n\r\nCustomer\'s request for additional carts are armed with accessories specialist. sideshift ie, rotator, positioner, bale clamps, hydraulic shovel, plow snow, etc.\r\n\r\nIn our offer you will also find:\r\n\r\n     fork\r\n     New and used tires\r\n     Masts for tractors\r\n     Spare parts for new and used\r\n\r\nIf you have any questions, please call or e-mail:\r\n\r\nBabin Olędry 10 62-420\r\nStrzałkowo\r\n Phone +48 602 725 994 or +48 666 843 578\r\nbiuro@wozki-pl.com','en'),(1,'','<div class=\"tsart\">\r\n<h1>O nas</h1>\r\n<img style=\"float: right; margin: 0 0 40px 40px;\" src=\"../../useruploads/images/o_nas/iStock_000016678686_ExtraSmall.jpg\" alt=\"w&oacute;zki widłowe strzałkowo\" width=\"425\" height=\"282\" />\r\n<p>Nasza firma funkcjonuje na polskim rynku od ponad 15 lat. Sprzedajemy używane w&oacute;zki widłowe oraz w&oacute;zki magazynowe renomowanych światowych producent&oacute;w. Dostarczamy m.in. sprzęty takich marek, jak Jungheinrich, Toyota, Linde, Mitsubishi, Nissan, Hyster oraz Baumann. Oferujemy r&oacute;wnież widły, opony oraz części zamienne - nowe i używane, a także maszty do ciągnik&oacute;w.</p>\r\n<p>Każdy oferowany przez nas w&oacute;zek widłowy posiada aktualny przegląd oraz kompleksową dokumentację techniczno-ruchową Urzędu Dozoru Technicznego. Tym samym może on być wykorzystany do pracy natychmiast po zakupie. Jednocześnie informujemy, że sprzedawane przez nas w&oacute;zki widłowe mogą być objęte także przeprowadzeniem dodatkowego badania UDT. Strzałkowo, Babin Olędry 10 &ndash; pod tym adresem odnajdziecie Państwo siedzibę naszej firmy, w kt&oacute;rej wykonamy badanie pozwalające bezproblemowo eksploatować zakupiony w&oacute;zek widłowy.</p>\r\n<p>Jeżeli wyrazicie Państwo chęć zakupu w&oacute;zka widłowego z dodatkowym osprzętem specjalistycznym, uzbroimy jego konstrukcję w odpowiednie części. Boczne przesuwy, obrotnice, pozycjonery, chwytaki do bel, szufle hydrauliczne, pługi śnieżne to zaledwie przykładowe z wielu propozycji, kt&oacute;re posiadamy w swojej ofercie.</p>\r\n<h2>W&oacute;zki widłowe Strzałkowo &ndash; poznajcie Państwo klika powod&oacute;w, dla kt&oacute;rych warto skorzystać z naszej oferty.</h2>\r\n<ul>\r\n<li><strong>Jesteśmy rzetelną i doświadczoną firmą</strong><br />Działając na rynku już od ponad 15 lat, doskonale poznaliśmy Państwa potrzeby względem posiadania funkcjonalnych, niezawodnych i sprawdzonych w&oacute;zk&oacute;w widłowych. Nasza starannie wyselekcjonowana oferta będzie doskonałą propozycja dla wszystkich os&oacute;b, kt&oacute;re pragną nabyć solidne, cechujące się najwyższą jakością maszyny do zadań specjalnych. Proponowane przez nas w&oacute;zki widłowe nie zawiodą Państwa oczekiwań. Indywidualne podejście do Klienta pozwala nam zrozumieć wymagania inwestor&oacute;w. Tym samym, pomagamy nabywcom odpowiednio wybrać określony model w&oacute;zka, kt&oacute;ry bez wątpienia stanie się najbardziej trafną i optymalną inwestycją.</li>\r\n<li><strong>Działamy profesjonalnie</strong><br />Naszym celem jest świadczenie usług na najwyższym poziomie. Dzięki wykwalifikowanej kadrze oraz posiadaniu w sprzedaży wyłącznie sprawdzonych i niezawodnych rozwiązań technologicznych, możemy Państwu zaoferować doskonałej klasy w&oacute;zki widłowe, części zamienne itp. Gwarantujemy profesjonalną obsługę Klienta. Uważamy, że każda forma sprzedaży powinna być podparta rzetelnym doradztwem. Decydując się na podjęcie z nami wsp&oacute;łpracy, możecie być Państwo pewni, że pomożemy Wam wybrać takie rozwiązania, kt&oacute;re najpełniej odpowiedzą na Wasze potrzeby.</li>\r\n<li><strong>Zapewniamy atrakcyjne ceny</strong><br />Doskonałą alternatywą dla drogich i nowych widlak&oacute;w będą tanie w&oacute;zki widłowe, kt&oacute;re jako sprzęty używane stanowią wyśmienitą propozycję dla wszystkich os&oacute;b pragnących zaoszczędzić na zakupie maszyn o specjalistycznym zastosowaniu. Atrakcyjna cena to niewątpliwie kluczowy atut naszej oferty. Jeśli zatem szukacie Państwo niedrogiego w&oacute;zka widłowego, kt&oacute;ry pozwoli usprawnić prace rozładunkowe w przedsiębiorstwie, magazynie, na hali lub w hurtowni, jesteśmy przekonani, że dzięki nam odnajdziecie interesujące Was rozwiązania.</li>\r\n</ul>\r\n<p>Serdecznie zachęcamy do skorzystania z naszej oferty. Dodatkowe pytania prosimy kierować na nasz adres mailowy lub dzwoniąc na podane na stronie numery telefon&oacute;w. Zapraszamy także do odwiedzenia naszego biura :</p>\r\n<p>W&oacute;zki widłowe &ndash; 62-420 Strzałkowo, Babin Olędry 10.<br /> Tel. 602 725 994 lub 666 843 578.<br /> <a href=\"mailto:biuro@wozki-pl.com\"> biuro@wozki-pl.com</a></p>\r\n</div>','pl'),(1,'О нас','Наша компания работает непрерывно в течение более 15 лет. Мы продаем подержанные погрузчики и складскую технику ведущих мировых брендов.\r\n\r\nПогрузчики, предлагаемые нами, каждый предмет к всеобъемлющему обзору технических, так что вы купили у нас оборудование готово к использованию сразу же.\r\n\r\nКаждая машина, проданная нами имеет полную техническую документацию - физические пользователем типа. По желанию, мы также проводят исследования UDT в нашей компании.\r\n\r\nЖеланию Заказчика дополнительные тележки имеют на вооружении специалистов аксессуаров. т.е. бокового смещения, ротатор, позиционер, захват для кип, гидравлическая лопата, снегоочиститель и т.д.\r\n\r\nВ нашем предложении вы найдете также:\r\n\r\n     вилка\r\n     Новые и подержанные шины\r\n     Мачты для тракторов\r\n     Запасные части для новых и подержанных\r\n\r\nЕсли у вас возникли вопросы, обращайтесь по телефону или по электронной почте:\r\n\r\nBabin Olędry 10 \r\n62-420 Strzalkowo','ru'),(2,'Gabelstapler Leasing','<p><span id=\"result_box\" class=\"long_text\" lang=\"de\"><span title=\"Jeśli myślą Państwo nad zakupem w&oacute;zk&oacute;w widłowych, a jednocześnie nie chcą Państwo ponosić ryzyka i obciążeń finansowych, związanych z kredytami bankowymi &ndash; zapraszamy do skorzystania z oferty leasingu.\">Wenn Sie den Kauf eines Gabelstaplers zu denken , und zur gleichen Zeit wollen nicht das Risiko und die finanzielle Belastung von Bankkrediten tragen - freuen sich, einen Mietvertrag anbieten.<br /><br /></span><span title=\"Leasing to jedna z najkorzystniejszych form zakupu maszyn i urządzeń, spośr&oacute;d wszystkich um&oacute;w zakupu, coraz bardziej powszechna w Polsce.\">Leasing ist eine der g&uuml;nstigsten Form der Kauf von Maschinen und Ger&auml;ten aller Kaufvertr&auml;ge , immer h&auml;ufiger in Polen. </span><span title=\"Decydując się na podpisanie umowy leasingowej, uzupełniają Państwo park maszynowy o nowoczesne iw pełni sprawne w&oacute;zki widłowe, nie ponosząc przy tym żadnego ryzyka inwestycyjnego.\">Die Entscheidung , den Mietvertrag zu unterschreiben, vervollst&auml;ndigen die Maschinerie der modernen und voll funktionsf&auml;hig Gabelstapler, ohne dass jedes Risiko der Investition.<br /><br /></span><span title=\"Aby zapewnić Państwu maksimum bezpieczeństwa przy zawieraniu umowy, wsp&oacute;łpracujemy z liderami usług leasingowych.\">F&uuml;r maximale Sicherheit bei der Eingabe in den Vertrag , arbeiten wir mit den F&uuml;hrern der Leasing. </span><span title=\"Stanowią oni gwarancję, że zawarta umowa i cały proces jej realizacji będą przebiegać bez zarzutu.\">Sie stellen eine Garantie daf&uuml;r, dass die Vereinbarung , und der Prozess der Umsetzung wird einwandfrei laufen.<br /><br /></span><span title=\"Najważniejsze korzyści przemawiające za leasingiem\">Der wichtigste Vorteil f&uuml;r Leasing<br /><br /></span></span></p>\r\n<ul>\r\n<li><span id=\"result_box\" class=\"long_text\" lang=\"de\"><span title=\"Najważniejsze korzyści przemawiające za leasingiem\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span title=\"należny podatek VAT naliczany jest od poszczeg&oacute;lnych opłat leasingowych z osobna, dzięki czemu nie trzeba płacić go w całości zaraz po zawarciu umowy,\">Die Mehrwertsteuer wird auf jeden Mietvertrag einzeln berechnet , so dass Sie nicht haben, um es in