ndividually, so you do not have to pay it in full immediately after the conclusion of the contract ,\r\n    initial payment and the lease payments can be counted as a cost przychoduleasing does not limit the exercise by the lessee of tradycyjnychform raise funds for investments , such as bank loans ,\r\n    Leasing provides access to innovative technical solutions and nowoczesnejtechnologii without involving their own funds ,\r\n    able to make rapid decisions and investment thus respond quickly to market conditions ,\r\n    Leasing is a flexible , fast and convenient way of acquiring fixed assets,\r\n    minimum of formalities , the simplified procedure .\r\n\r\nLeasing offer is tailored to individual needs and abilities of each client','en'),(2,'Leasing wózków widłowych','<p><img style=\"float: right; margin: 0 0 40px 40px;\" title=\"w&oacute;zki widłowe leasing\" src=\"../../useruploads/images/leasing/iStock_000000459029_ExtraSmall.jpg\" alt=\"w&oacute;zki widłowe leasing\" width=\"420\" height=\"286\" />Jeśli myślą Państwo nad zakupem w&oacute;zk&oacute;w widłowych, a jednocześnie nie chcą Państwo ponosić ryzyka i obciążeń finansowych, związanych z kredytami bankowymi &ndash; zapraszamy do skorzystania z oferty leasingu.<br /><br /><strong>Leasing</strong> to jedna z najkorzystniejszych form zakupu maszyn i urządzeń, spośr&oacute;d wszystkich um&oacute;w zakupu, coraz bardziej powszechna w Polsce. Decydując się na podpisanie umowy leasingowej, uzupełniają Państwo park maszynowy o nowoczesne i w pełni sprawne w&oacute;zki widłowe, nie ponosząc przy tym żadnego ryzyka inwestycyjnego.<br /><br />Aby zapewnić Państwu maksimum bezpieczeństwa przy zawieraniu umowy, wsp&oacute;łpracujemy <strong>z liderami usług leasingowych</strong>. Stanowią oni gwarancję, że zawarta umowa i cały proces jej realizacji będą przebiegać bez zarzutu.<br /><br /><strong>Najważniejsze korzyści przemawiające za leasingiem</strong></p>\r\n<ul>\r\n<li>należny podatek VAT naliczany jest od poszczeg&oacute;lnych opłat leasingowych z osobna, dzięki czemu nie trzeba płacić go w całości zaraz po zawarciu umowy,</li>\r\n<li>wpłatę początkową oraz raty leasingowe można wliczyć do koszt&oacute;w uzyskania przychoduleasing nie ogranicza możliwości korzystania przez leasingobiorcę z tradycyjnychform pozyskiwania środk&oacute;w na inwestycje, np. kredytu bankowego,</li>\r\n<li>leasing umożliwia dostęp do innowacyjnych rozwiązań technicznych i nowoczesnejtechnologii bez angażowania własnych środk&oacute;w,</li>\r\n<li>możliwość podejmowania błyskawicznych decyzji inwestycyjnych i co za tym idzie natychmiastowe reagowanie na sytuację rynkową,</li>\r\n<li>leasing to elastyczna, szybka i wygodna forma pozyskiwania środk&oacute;w trwałych,</li>\r\n<li>minimum formalności, uproszczona procedura.</li>\r\n</ul>\r\n<p>Oferta leasingowa jest dostosowana do indywidualnych potrzeb i możliwości każdego klienta</p>','pl'),(2,'Лизинг погрузчиков','Если вы думаете о покупкепогрузчика , и в то же время не хотят нести риски и финансовое бремя банковских кредитов - рады предложитьаренду.\r\n\r\nЛизинг является одним из наиболее благоприятных формприобретение машин и оборудования всех договоров купли-продажи , становится все более распространенной в Польше. Решение подписать договор аренды , завершить современной техники и полностью функциональный погрузчик , без каких-либо рисков инвестиций.\r\n\r\nДля максимальной безопасности при заключении договора , мы работаем с руководителями лизинговых услуг. Они представляют собой гарантию того, что соглашения и ходе ее реализации будет работать безупречно.\r\n\r\nНаиболее важным преимуществом в пользу лизинга\r\n\r\n    НДС взимается с каждой аренды индивидуально , так что вам не придется платить его в полном объеме сразу после заключения договора ,\r\n    первоначального взноса и лизинговых платежей может быть расценено какстоимость przychoduleasing не ограничивает осуществление арендатором tradycyjnychform сбору средств на инвестиции, такие как банковские кредиты,\r\n    Лизинг предоставляет доступ к инновационным техническим решениям и nowoczesnejtechnologii без привлечения собственных средств,\r\n    возможность принимать быстрые решения и инвестиции таким образом, быстро реагировать на рыночные условия ,\r\n    Лизинг представляет собой гибкий , быстрый и удобный способ приобретения основных средств,\r\n    Минимум формальностей , в упрощенном порядке .\r\n\r\nЛизинговые предложения с учетом индивидуальных потребностей и возможностей каждого клиента','ru'),(3,'Gabelstapler Leasing','<p><span id=\"result_box\" lang=\"de\"><span class=\"hps\">Wenn</span> <span class=\"hps\">Sie den Kauf</span> <span class=\"hps\">eines Gabelstaplers</span> <span class=\"hps\">zu denken</span><span>,</span> <span class=\"hps\">und</span> <span class=\"hps\">zur gleichen Zeit</span> <span class=\"hps\">wollen nicht</span> <span class=\"hps\">das Risiko und die</span> <span class=\"hps\">finanzielle Belastung</span> <span class=\"hps\">von Bankkrediten</span> <span class=\"hps\">tragen</span> <span class=\"hps\">-</span> <span class=\"hps\">freuen sich,</span> <span class=\"hps\">einen Mietvertrag</span> <span class=\"hps\">anbieten.</span></span></p>','de'),(3,'Forklift Leasing','If you are thinking of buying a forklift truck, and at the same time do not want to bear the risk and financial burden of bank loans - are pleased to offer a lease.','en'),(3,'Leasing wózków widłowych','<p>Jeśli myślą Państwo nad zakupem w&oacute;zk&oacute;w widłowych, a jednocześnie nie chcą Państwo ponosić ryzyka i obciążeń finansowych, związanych z kredytami bankowymi &ndash; zapraszamy do skorzystania z oferty leasingu.</p>','pl'),(3,'Лизинг погрузчиков','Если вы думаете о покупке погрузчика, и в то же время не хотят нести риски и финансовое бремя банковских кредитов - рады предложить аренду.','ru'),(4,'Transport','<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna ali